import { createRouter, createWebHistory } from "vue-router";
import Dashboard from "./layouts/Dashboard.vue";
import useUserStore from "./stores/user";

const routes = [
  {
    path: "/",
    name: "app",
    component: Dashboard,
    meta: {
      requiresAuth: true,
    },
    children: [
      {
        path: "",
        name: "dashboard",
        component: () => import("./components/Dashboard.vue"),
      },
      {
        path: "/me",
        name: "me",
        component: () => import("./pages/Me.vue"),
      },
      {
        path: "/address-settings",
        name: "address-settings",
        component: () => import("./pages/Address.vue"),
      },
      {
        path: "/wallet-settings",
        name: "wallet-settings",
        component: () => import("./pages/Wallet.vue"),
      },
      {
        path: '/list',
        name: 'list',
        component: () => import('./components/ListDemo.vue')
    },
      {
        path: "/statement",
        name: "statement",
        component: () => import("./pages/Statement.vue"),
      },
      {
        path: "/invoices",
        name: "invoices",
        component: () => import("./pages/Invoices.vue"),
      },
      {
        path: "/withdrawals",
        name: "withdrawals",
        component: () => import("./pages/Withdrawals.vue"),
      },
      {
        path: "/ticket",
        name: "ticket",
        component: () => import("./pages/Ticket.vue"),
      },
      {
        path: "/new-ticket",
        name: "new-ticket",
        component: () => import("./pages/NewTicket.vue"),
      },
      {
        path: "/Solicitations",
        name: "solicitations",
        component: () => import("./pages/SolicitationStatus.vue"),
      },
      {
        path: "/request-withdrawal",
        name: "request-withdrawal",
        component: () => import("./pages/RequestWithdrawal.vue"),
      },
      {
        path: "/downloads",
        name: "downloads",
        component: () => import("./pages/Downloads.vue"),
      },
      {
        path: "/transfer",
        name: "transfer",
        component: () => import("./pages/Transfer.vue"),
      },
      {
        path: "/pay-funds",
        name: "pay-funds",
        component: () => import("./pages/PayFunds.vue"),
      },
      {
        path: "/videos",
        name: "videos",
        component: () => import("./pages/Videos.vue"),
      },
      {
        path: "/binary-network",
        name: "binary-network",
        component: () => import("./pages/BinaryNetwork.vue"),
      },
      {
        path: "/my-referrals",
        name: "my-referrals",
        component: () => import("./pages/MyReferrals.vue"),
      },
      {
        path: "/new-referral",
        name: "new-referral",
        component: () => import("./pages/NewReferral.vue"),
      },
      {
        path: "/password-page",
        name: "password-page",
        component: () => import("./pages/PasswordPage.vue"),
      },
      {
        path: "/my-plans",
        name: "my-plans",
        component: () => import("./pages/MyPlans.vue"),
      },
      {
        path: "/Upgrades",
        name: "upgrades",
        component: () => import("./pages/Upgrades.vue"),
      },
    ],
  },
  {
    path: "/login",
    name: "login",
    component: () => import("./pages/Login.vue"),
  },
  {
    path: "/register",
    name: "register",
    component: () => import("./pages/Register.vue"),
  },
  {
    path: "/forgot-password",
    name: "forgotPassword",
    component: () => import("./pages/ForgotPassword.vue"),
  },
  {
    path: "/reset-password",
    name: "resetPassword",
    component: () => import("./pages/ResetPassword.vue"),
  },
  {
    path: "/validate-data",
    name: "validateData",
    component: () => import("./pages/ValidateData.vue"),
  },
  {
    path: "/landing",
    name: "landing",
    component: () => import("./pages/LandingDemo.vue"),
  },
  {
    path: "/error",
    name: "error",
    component: () => import("./pages/Error.vue"),
  },
  {
    path: "/notfound",
    name: "notfound",
    component: () => import("./pages/NotFound.vue"),
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

router.beforeEach((to, from, next) => {
  if (to.matched.some((record) => record.meta?.requiresAuth)) {
    const store = useUserStore();
    if (store.token) {
      next();
    } else {
      next("/login");
    }
  }

  next();
});

export default router;
